import React, { View, Component } from 'react';
import './App.css';

function Circle(props){

    return(
      <div className="Circle">
      <svg height="100" width="100">
        <text > Hello! </text>
        <circle cx="50" cy="50" r="40" stroke="grey" stroke-width="2" fill="pink" />

      </svg>
      <div className="Label">
        {props.label}
      </div>

      </div>
    );

}

class Menu extends Component{
  render(){

    return (
      <Circle label="hi there"/>

    );

  }

}
export default Menu;
